import AuthCtx from "./Task8";

function CompB() {
  const context = useContext(AuthCtx);
  const { Counter, setCounter } = context;

  return (
    <div>
      <h4>CompB</h4>
      <button onClick={(e) => setCounter(Counter + 10)}>Decrease</button>
    </div>
  );
}

export default CompB;
